// AutograderServiceServer is the server API for AutograderService service.
type AutograderServiceServer interface {
	// GetUser will return current user with active course enrollments
	// to use in separating teacher and admin roles
	GetUser(context.Context, *Void) (*User, error)
	GetUsers(context.Context, *Void) (*Users, error)
	UpdateUser(context.Context, *User) (*User, error)
	IsAuthorizedTeacher(context.Context, *Void) (*AuthorizationResponse, error)
	GetGroup(context.Context, *RecordRequest) (*Group, error)
	GetGroupByUserAndCourse(context.Context, *GroupRequest) (*Group, error)
	GetGroups(context.Context, *RecordRequest) (*Groups, error)
	CreateGroup(context.Context, *Group) (*Group, error)
	UpdateGroup(context.Context, *Group) (*Void, error)
	DeleteGroup(context.Context, *RecordRequest) (*Void, error)
	GetCourse(context.Context, *RecordRequest) (*Course, error)
	GetCourses(context.Context, *Void) (*Courses, error)
	GetCoursesWithEnrollment(context.Context, *RecordRequest) (*Courses, error)
	CreateCourse(context.Context, *Course) (*Course, error)
	UpdateCourse(context.Context, *Course) (*Void, error)
	// GetAssignments returns the assignments for the given course.
	GetAssignments(context.Context, *RecordRequest) (*Assignments, error)
	// UpdateAssignments updates the assignments on the backend for the given course
	// by fetching assignment information from the course's test repository.
	UpdateAssignments(context.Context, *RecordRequest) (*Void, error)
	GetEnrollmentsByCourse(context.Context, *EnrollmentRequest) (*Enrollments, error)
	CreateEnrollment(context.Context, *Enrollment) (*Void, error)
	UpdateEnrollment(context.Context, *Enrollment) (*Void, error)
	GetSubmissions(context.Context, *SubmissionRequest) (*Submissions, error)
	// ApproveSubmission approves the given submission for a course.
	// Only teachers can invoke this.
	ApproveSubmission(context.Context, *ApproveSubmissionRequest) (*Void, error)
	RefreshSubmission(context.Context, *RecordRequest) (*Void, error)
	GetProviders(context.Context, *Void) (*Providers, error)
	GetOrganizations(context.Context, *Provider) (*Organizations, error)
	// use to batch all repository URL requests into one gRPC call
	GetRepositories(context.Context, *URLRequest) (*Repositories, error)
}

